        Очередной дневальный по бригу несет службу внутри брига у входной двери. Он обязан:


        - никуда не отлучаться из брига без разрешения смотрителя; постоянно наблюдать за комнатой для хранения оружия;


        - не пропускать в помещение брига посторонних лиц, а также не допускать выноса из казармы оружия, боеприпасов, имущества и вещей без разрешения смотрителя;


        - немедленно докладывать смотрителю обо всех происшествиях в бриге, о нарушении уставных правил взаимоотношений между сотрудниками СБ, замеченных неисправностях и нарушениях требований пожарной безопасности, принимать меры к их устранению;


        - следить за чистотой и порядком в помещениях и требовать их соблюдения от военнослужащих;


        - следить за тем, чтобы сотрудники СБ курили, чистили обувь и одежду только в отведенных для этого помещениях или местах;


        - по прибытии в бриг прямых начальников от ГСБ и выше и представителей ЦК подавать команду "Смирно";


        - дневальному запрещается садиться, снимать снаряжение и расстегивать одежду.
